<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8">

        <title>Document</title>

        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
        <meta name="description" content="Description">
        <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">

        <!--  -->

        <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/docsify@4/lib/themes/vue.css">

        <!--  -->

        <!-- plugin: docsify-darklight-theme -->
        <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/docsify-darklight-theme@latest/dist/style.min.css" title="docsify-darklight-theme" type="text/css"/>

        <!-- plugin: docsify-sidebar-collapse -->
        <link rel="stylesheet" type="text/css" href="/assets/css/docsify-sidebar-collapse/sidebar.css">

        <!--  -->
        
        <link rel="icon" href="/assets/images/icon.png">
        <link rel="stylesheet" type="text/css" href="/assets/css/style.css">
    </head>
    
    <body>
        <div id="app"></div>

        <!--  -->

        <script>
            window.$docsify = {
                name: 'MIDL UT3',
                repo: '',

                logo: '/assets/images/banner.png',
                
                loadSidebar: true,

                relativePath: true,

                alias: {
                    '/(.*)/': '/$1'
                }
            }
        </script>

        <!--  -->

        <!-- Docsify v4 -->
        <script src="https://cdn.jsdelivr.net/npm/docsify@4/lib/docsify.min.js"></script>

        <!--  -->

        <!-- plugin: docsify-darklight-theme -->
        <script src="//cdn.jsdelivr.net/npm/docsify-darklight-theme@latest/dist/index.min.js" type="text/javascript"></script>

        <!-- plugin: docsify-sidebar-collapse -->
        <script src="//cdn.jsdelivr.net/npm/docsify-sidebar-collapse/dist/docsify-sidebar-collapse.min.js"></script>

        <!-- plugin: search -->
        <script src="https://cdn.jsdelivr.net/npm/docsify@4/lib/plugins/search.js"></script>
        
        <!-- plugin: zoom-image -->
        <script src="https://cdn.jsdelivr.net/npm/docsify@4/lib/plugins/zoom-image.min.js"></script>
    </body>
</html>
